import React from 'react';

const ServiceBlockLeft = (props) => {
    return(
        <div className="row no-margin">
            <div className="col-6 service-colored-section">
                <div className="service-icon">
                    <img src={props.image} />
                </div>
                <h3 className="icon-heading">{props.name}Fact Check</h3>
            </div>
            <div className="col-6 service-desc-section">
                <h4 className="service-heading">{props.tag}</h4>
                <p className="service-writeup">{props.description}
                </p>
            </div>
        </div>
    );
}

export default ServiceBlockLeft;
